import React from 'react'

const Category = () => {

    const categorys = [
        {
            categoryId : "all",
            categoryName : "All"
        },
        {
            categoryId : "diagnostic_equipment",
            categoryName : "Diagnostic Equipment"
        },
        {
            categoryId : "surgical_equipment",
            categoryName : "Surgical Equipment"
            },

        "Monitoring Equipment",
        "Life Support Equipment",
        "Patient Care Equipment",
        "Laboratory Equipment",
        "Rehabilitation Equipment",
        "Imaging Equipment",
        "Emergency and Trauma Equipment",
        "Medical Furniture and Storage"
    ]
  return (
    <div style={{width:"100%",padding:"10px 100px",marginBottom:"40px",overflow:"hidden"}}>
        <div style={{display:"flex", justifyContent:"center", alignItems:"center",flexWrap:"wrap"}}>
            {
                categorys.map((category) => {
                    return (
                        <div style={{width:"auto",marginRight:"20px",marginBottom:"10px"}}>
                            <article style={{}}>{category}</article>
                        </div>
                    )
                })
            }
        </div>
    </div>
  )
}

export default Category
